import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function customer() {
  return (
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1},
      }}
      noValidate
      autoComplete="off"
    >
      <TextField id="outlined-basic" label="Customer ID" variant="standard" />
      <TextField id="filled-basic" label="Customer Firstname" variant="filled" />
      <TextField id="standard-basic" label="Customer Lastname" variant="outlined" />
    </Box>
  );
}
